    the system caught that $1000 too much had been paid to Citizens for Harkin for
    the Primary ($1000 in Dec '06, $1000 in Apr '07, and $4000 in May '07).  Citizens
    for Harkin was contacted and I spoke with Molly (10:55am).  She indicated that
    Teresa Kehough is the bookkeeper and she will be given the information regarding
    the overpayment and will cut a $1000 check back to AGPAC.  I left my phone number
    for contact purposes if needed.         (06/15/07, 11:05am)  I called and left
    a message with our new FEC contact (Sui Lang Panoke) asking for clarification
    on how to file this error.                   (06/18/07, 9:45am)  Sui Lang called
    me back and indicated to just do a Memo Text within the June 20 Monthly filing
    indicating the situation.  She also indicated that next month we will need to
    log the $1000 refund on Line 16 of our filing, and again do a Memo Text to briefly
    explain.                                                                        (06/22/07)  Check
    deposited into AGPAC account."
